import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.css";
import React from 'react';
import { Container, Navbar } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Router>
        <header className='App-header'>
          <Navbar bg="dark" variant='dark'>
            <Container></Container>
          </Navbar>
        </header>
      </Router>
    </div>
  );
}

export default App;
